import { Router , Route, Routes } from "react-router-dom";
import Home from "./components/Home"
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" exact element={ <Home/>} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
